let RegionmasterviewComponent = class RegionmasterviewComponent {
    constructor(os, fb, ps, titleService) {
        this.os = os;
        this.fb = fb;
        this.ps = ps;
        this.titleService = titleService;
        this.title = 'Region Master';
        this.statusvalues = [
            { value: '1', viewValue: 'ACTIVE' },
            { value: '2', viewValue: 'IN-ACTIVE' },
        ];
        // pager object
        this.pager = {};
        this.DepartmentList = [];
        this.ActivateAddEditDepComp = false;
        this.isDesc = false;
        this.column = '';
    }
    ngOnInit() {
        this.titleService.setTitle(this.title);
        $('.my-select').select2();
        this.createForm();
        this.RegionList();
    }
    RegionList() {
        this.os.getRegionList(this.searchForm.value).subscribe(data => {
            this.allItems = data;
            this.setPage(1);
        });
    }
    createForm() {
        this.searchForm = this.fb.group({
            ID: 0,
            RegionName: '',
            Status: 0,
            StatusV: ''
        });
    }
    clearSearch() {
        this.searchForm.value.Status = $('#ddlStatusv').val();
        this.createForm();
        this.RegionList();
        $("#ddlStatusv").val(0).trigger("change");
    }
    onSubmit() {
        this.searchForm.value.Status = $('#ddlStatusv').val();
        this.os.getRegionList(this.searchForm.value).subscribe(city => {
            this.allItems = city;
            this.setPage(1);
        });
    }
    highlightRow(dataItem) {
        this.selectedName = dataItem.CityCode;
    }
    setPage(page) {
        //if (page < 1 || page > this.pager.totalPages) {
        //    return;
        //}
        this.pager = this.ps.getPager(this.allItems.length, page);
        this.pagedItems = this.allItems.slice(this.pager.startIndex, this.pager.endIndex + 1);
    }
    sort(property) {
        this.isDesc = !this.isDesc; //change the direction    
        this.column = property;
        let direction = this.isDesc ? 1 : -1;
        this.pagedItems.sort(function (a, b) {
            if (a[property] < b[property]) {
                return -1 * direction;
            }
            else if (a[property] > b[property]) {
                return 1 * direction;
            }
            else {
                return 0;
            }
        });
    }
    ;
};
