let DocumentnumberingviewComponent = class DocumentnumberingviewComponent {
    constructor(ms, cs, fb, ps, titleService) {
        this.ms = ms;
        this.cs = cs;
        this.fb = fb;
        this.ps = ps;
        this.titleService = titleService;
        this.title = 'Document Numbering';
        this.statusvalues = [
            { value: '1', viewValue: 'ACTIVE' },
            { value: '2', viewValue: 'IN-ACTIVE' },
        ];
        // pager object
        this.pager = {};
    }
    ngOnInit() {
        this.titleService.setTitle(this.title);
        $('.my-select').select2();
        this.createForm();
        this.DocNumbList();
        this.onInitalBinding();
    }
    DocNumbList() {
        this.ms.getDocNumbList(this.searchForm.value).subscribe(data => {
            // set items to json response
            this.allItems = data;
            // initialize to page 1
            this.setPage(1);
        });
    }
    onInitalBinding() {
        this.OnBindDropdownLiner();
    }
    OnBindDropdownLiner() {
        this.cs.getLinerNameList(this.searchForm.value).subscribe(data => {
            this.linerItem = data;
        });
    }
    onSubmit() {
        this.searchForm.value.Status = $('#ddlStatus').val();
        this.ms.getDocNumbList(this.searchForm.value).subscribe(DocumentNumbering => {
            this.allItems = DocumentNumbering;
            this.setPage(1);
        });
    }
    createForm() {
        this.searchForm = this.fb.group({
            ID: 0,
            LinerID: 0,
            Status: 0,
            Module: 0,
            Program: 0
        });
    }
    clearSearch() {
        this.searchForm.value.Status = $('#ddlStatus').val();
        this.createForm();
        this.DocNumbList();
        $('#ddlStatus').val(0).trigger("change");
    }
    highlightRow(dataItem) {
        this.selectedName = dataItem.CityCode;
    }
    setPage(page) {
        //if (page < 1 || page > this.pager.totalPages) {
        //    return;
        //}
        // get pager object from service
        this.pager = this.ps.getPager(this.allItems.length, page);
        // get current page of items
        this.pagedItems = this.allItems.slice(this.pager.startIndex, this.pager.endIndex + 1);
    }
};
