let NotesclauseviewComponent = class NotesclauseviewComponent {
    constructor(ms, fb, ps, titleService) {
        this.ms = ms;
        this.fb = fb;
        this.ps = ps;
        this.titleService = titleService;
        this.title = 'Notes & Clauses';
        // pager object
        this.pager = {};
    }
    ngOnInit() {
        this.titleService.setTitle(this.title);
        this.createForm();
        this.NotesClausesList();
    }
    NotesClausesList() {
        this.ms.getNotesList(this.searchForm.value).subscribe(data => {
            // set items to json response
            this.allItems = data;
            // initialize to page 1
            this.setPage(1);
        });
    }
    createForm() {
        this.searchForm = this.fb.group({
            ID: 0,
            GeneralName: ''
        });
    }
    onSubmit() {
        this.ms.getNotesList(this.searchForm.value).subscribe(Notes => {
            this.allItems = Notes;
            this.setPage(1);
        });
    }
    clearSearch() {
        this.createForm();
        this.NotesClausesList();
    }
    setPage(page) {
        //if (page < 1 || page > this.pager.totalPages) {
        //    return;
        //}
        // get pager object from service
        this.pager = this.ps.getPager(this.allItems.length, page);
        // get current page of items
        this.pagedItems = this.allItems.slice(this.pager.startIndex, this.pager.endIndex + 1);
    }
};
