let InventorymoveviewComponent = class InventorymoveviewComponent {
    constructor(IS, fb, ps, titleService) {
        this.IS = IS;
        this.fb = fb;
        this.ps = ps;
        this.titleService = titleService;
        this.title = 'Inventory Move Creation';
        this.statusvalues = [
            { value: '1', viewValue: 'ACTIVE' },
            { value: '2', viewValue: 'IN-ACTIVE' },
        ];
        this.pager = {};
        this.DepartmentList = [];
        this.ActivateAddEditDepComp = false;
        this.isDesc = false;
        this.column = '';
    }
    ngOnInit() {
        this.titleService.setTitle(this.title);
        $('.my-select').select2();
        $(document).on('select2:open', (e) => {
            const selectId = e.target.id;
            $(".select2-search__field[aria-controls='select2-" + selectId + "-results']").each(function (key, value) {
                value.focus();
            });
        });
        this.createForm();
        this.MoveList();
    }
    MoveList() {
        this.IS.getMoveList(this.searchForm.value).subscribe(data => {
            this.allItems = data;
            this.setPage(1);
        });
    }
    createForm() {
        this.searchForm = this.fb.group({
            ID: 0,
            Status: '',
            StatusID: 0
        });
    }
    clearSearch() {
        this.searchForm.value.StatusID = $('#ddlStatusv').val();
        this.createForm();
        this.MoveList();
        $('#ddlStatusv').val(0).trigger("change");
    }
    onSubmit() {
        this.searchForm.value.StatusID = $('#ddlStatusv').val();
        this.IS.getMoveList(this.searchForm.value).subscribe(off => {
            this.allItems = off;
            this.setPage(1);
        });
    }
    highlightRow(dataItem) {
        this.selectedName = dataItem.CityCode;
    }
    setPage(page) {
        //if (page < 1 || page > this.pager.totalPages) {
        //    return;
        //}
        this.pager = this.ps.getPager(this.allItems.length, page);
        this.pagedItems = this.allItems.slice(this.pager.startIndex, this.pager.endIndex + 1);
    }
    sort(property) {
        this.isDesc = !this.isDesc; //change the direction    
        this.column = property;
        let direction = this.isDesc ? 1 : -1;
        this.pagedItems.sort(function (a, b) {
            if (a[property] < b[property]) {
                return -1 * direction;
            }
            else if (a[property] > b[property]) {
                return 1 * direction;
            }
            else {
                return 0;
            }
        });
    }
    ;
};
