let VoyageviewComponent = class VoyageviewComponent {
    constructor(ms, fb, ps, titleService) {
        this.ms = ms;
        this.fb = fb;
        this.ps = ps;
        this.titleService = titleService;
        this.title = 'Voyage Master';
        // pager object
        this.pager = {};
        this.isDesc = false;
        this.column = '';
    }
    ngOnInit() {
        this.titleService.setTitle(this.title);
        $('.my-select').select2();
        $(document).on('select2:open', (e) => {
            const selectId = e.target.id;
            $(".select2-search__field[aria-controls='select2-" + selectId + "-results']").each(function (key, value) {
                value.focus();
            });
        });
        this.createForm();
        this.refreshDepList();
        this.OnBindDropdownVessel();
    }
    OnBindDropdownVessel() {
        this.ms.getVesselBind(this.searchForm.value).subscribe(data => {
            this.ddlVesselItem = data;
        });
    }
    refreshDepList() {
        this.ms.getVoyageViewlist(this.searchForm.value).subscribe(data => {
            this.allItems = data;
            this.setPage(1);
        });
    }
    onSubmit() {
        this.searchForm.value.VesselID = $('#ddlVesselv').val();
        this.refreshDepList();
    }
    clearSearch() {
        this.createForm();
        this.refreshDepList();
        $('#ddlVesselv').val(0).trigger("change");
    }
    createForm() {
        this.searchForm = this.fb.group({
            ID: 0,
            VoyageNo: '',
            VesselID: 0,
        });
    }
    setPage(page) {
        //if (page < 1 || page > this.pager.totalPages) {
        //    return;
        //}
        // get pager object from service
        this.pager = this.ps.getPager(this.allItems.length, page);
        // get current page of items
        this.pagedItems = this.allItems.slice(this.pager.startIndex, this.pager.endIndex + 1);
    }
    sort(property) {
        this.isDesc = !this.isDesc; //change the direction    
        this.column = property;
        let direction = this.isDesc ? 1 : -1;
        this.pagedItems.sort(function (a, b) {
            if (a[property] < b[property]) {
                return -1 * direction;
            }
            else if (a[property] > b[property]) {
                return 1 * direction;
            }
            else {
                return 0;
            }
        });
    }
    ;
};
