let ContypemasterviewComponent = class ContypemasterviewComponent {
    constructor(ms, fb, ps, titleService) {
        this.ms = ms;
        this.fb = fb;
        this.ps = ps;
        this.titleService = titleService;
        this.title = 'ContainerType Master';
        // pager object
        this.pager = {};
        this.isDesc = false;
        this.column = '';
    }
    ngOnInit() {
        this.titleService.setTitle(this.title);
        //$('.my-select').select2();
        //$(document).on('select2:open', (e) => {
        //    const selectId = e.target.id
        //    $(".select2-search__field[aria-controls='select2-" + selectId + "-results']").each(function (
        //        key,
        //        value,
        //    ) {
        //        value.focus();
        //    })
        //})
        this.createForm();
        this.refreshDepList();
    }
    refreshDepList() {
        this.ms.getContTypeList(this.searchForm.value).subscribe(data => {
            // set items to json response
            this.allItems = data;
            // initialize to page 1
            this.setPage(1);
        });
    }
    createForm() {
        this.searchForm = this.fb.group({
            ID: 0,
            Type: '',
            Size: '',
            ISOCode: '',
            Status: 0,
        });
    }
    clearSearch() {
        this.createForm();
        this.refreshDepList();
    }
    onSubmit() {
        this.refreshDepList();
    }
    setPage(page) {
        //if (page < 1 || page > this.pager.totalPages) {
        //    return;
        //}
        // get pager object from service
        this.pager = this.ps.getPager(this.allItems.length, page);
        // get current page of items
        this.pagedItems = this.allItems.slice(this.pager.startIndex, this.pager.endIndex + 1);
    }
    sort(property) {
        this.isDesc = !this.isDesc; //change the direction    
        this.column = property;
        let direction = this.isDesc ? 1 : -1;
        this.pagedItems.sort(function (a, b) {
            if (a[property] < b[property]) {
                return -1 * direction;
            }
            else if (a[property] > b[property]) {
                return 1 * direction;
            }
            else {
                return 0;
            }
        });
    }
    ;
};
