let PortviewComponent = class PortviewComponent {
    constructor(ms, fb, ps, titleService) {
        this.ms = ms;
        this.fb = fb;
        this.ps = ps;
        this.titleService = titleService;
        this.title = 'Port Master';
        this.seaportvalues = [
            { value: '1', viewValue: 'YES' },
            { value: '2', viewValue: 'NO' },
        ];
        this.icdportvalues = [
            { value: '1', viewValue: 'YES' },
            { value: '2', viewValue: 'NO' },
        ];
        this.statusvalues = [
            { value: '1', viewValue: 'ACTIVE' },
            { value: '2', viewValue: 'IN-ACTIVE' },
        ];
        this.pager = {};
        this.isDesc = false;
        this.column = '';
    }
    ngOnInit() {
        this.titleService.setTitle(this.title);
        $('.my-select').select2();
        $(document).on('select2:open', (e) => {
            const selectId = e.target.id;
            $(".select2-search__field[aria-controls='select2-" + selectId + "-results']").each(function (key, value) {
                value.focus();
            });
        });
        this.createForm();
        this.PageLoadingPortList();
    }
    PageLoadingPortList() {
        this.ms.getPortList(this.searchForm.value).subscribe(data => {
            this.allItems = data;
            this.setPage(1);
        });
    }
    createForm() {
        this.searchForm = this.fb.group({
            ID: 0,
            PortCode: '',
            PortName: '',
            CountryCode: '',
            MainPort: '',
            SeaPort: '',
            ICDPort: '',
            IsSeaPort: 0,
            IsICDPort: 0,
            Status: 0
        });
    }
    setPage(page) {
        //if (page < 1 || page > this.pager.totalPages) {
        //    return;
        //}
        // get pager object from service
        this.pager = this.ps.getPager(this.allItems.length, page);
        // get current page of items
        this.pagedItems = this.allItems.slice(this.pager.startIndex, this.pager.endIndex + 1);
    }
    onSubmit() {
        this.searchForm.value.Status = $('#ddlStatusv').val();
        this.searchForm.value.IsSeaPort = $('#ddlSeaPort').val();
        this.searchForm.value.IsICDPort = $('#ddlICDPort').val();
        this.PageLoadingPortList();
    }
    clearSearch() {
        this.searchForm.value.Status = $('#ddlStatusv').val();
        this.searchForm.value.IsSeaPort = $('#ddlSeaPort').val();
        this.searchForm.value.IsICDPort = $('#ddlICDPort').val();
        this.createForm();
        this.PageLoadingPortList();
        $('#ddlStatusv').val(0).trigger("change");
        $('#ddlSeaPort').val(0).trigger("change");
        $('#ddlICDPort').val(0).trigger("change");
    }
    sort(property) {
        this.isDesc = !this.isDesc; //change the direction    
        this.column = property;
        let direction = this.isDesc ? 1 : -1;
        this.pagedItems.sort(function (a, b) {
            if (a[property] < b[property]) {
                return -1 * direction;
            }
            else if (a[property] > b[property]) {
                return 1 * direction;
            }
            else {
                return 0;
            }
        });
    }
    ;
};
