let VendorviewComponent = class VendorviewComponent {
    constructor(cs, fb, ps, ms, titleService) {
        this.cs = cs;
        this.fb = fb;
        this.ps = ps;
        this.ms = ms;
        this.titleService = titleService;
        this.title = 'Vendor  Master';
        this.pager = {};
        this.DepartmentList = [];
        this.ActivateAddEditDepComp = false;
        this.isDesc = false;
        this.column = '';
    }
    ngOnInit() {
        this.titleService.setTitle(this.title);
        $('.my-select').select2();
        $(document).on('select2:open', (e) => {
            const selectId = e.target.id;
            $(".select2-search__field[aria-controls='select2-" + selectId + "-results']").each(function (key, value) {
                value.focus();
            });
        });
        this.createForm();
        this.OnBindDropdownCountry();
        this.partyList();
    }
    partyList() {
        //this.searchForm.value.CountryID = $('#ddlCountry').val();
        this.cs.getVendorList(this.searchForm.value).subscribe(data => {
            this.allItems = data;
            this.setPage(1);
        });
    }
    OnBindDropdownCountry() {
        this.ms.getCountryBind().subscribe(data => {
            this.dscountryItem = data;
        });
    }
    createForm() {
        this.searchForm = this.fb.group({
            ID: 0,
            CustomerName: '',
            CountryID: 0,
        });
    }
    clearSearch() {
        this.createForm();
        this.partyList();
    }
    onSubmit() {
        this.searchForm.value.CountryID = $('#ddlCountry').val();
        this.cs.getVendorList(this.searchForm.value).subscribe(data => {
            this.allItems = data;
            this.setPage(1);
        });
    }
    highlightRow(dataItem) {
        this.selectedName = dataItem.CityCode;
    }
    setPage(page) {
        //if (page < 1 || page > this.pager.totalPages) {
        //    return;
        //}
        // get pager object from service
        this.pager = this.ps.getPager(this.allItems.length, page);
        // get current page of items
        this.pagedItems = this.allItems.slice(this.pager.startIndex, this.pager.endIndex + 1);
    }
    sort(property) {
        this.isDesc = !this.isDesc; //change the direction    
        this.column = property;
        let direction = this.isDesc ? 1 : -1;
        this.pagedItems.sort(function (a, b) {
            if (a[property] < b[property]) {
                return -1 * direction;
            }
            else if (a[property] > b[property]) {
                return 1 * direction;
            }
            else {
                return 0;
            }
        });
    }
    ;
};
